import React from "react";
import Coverr from "../../img/bg-lang.png";

const Lang = () => {
  return (
    <div className="lang-bg">
      <div className="divv">
        <img src={Coverr} alt="" />
        <div className="div">
          <button className="button r-button">Share</button>
        </div>
      </div>
    </div>
  );
};

export default Lang;
